(1012, 'wpbe_options', 'a:4:{s:9:"from_name";s:0:"";s:10:"from_email";s:0:"";s:8:"template";s:2902:"<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Transitional//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd">\r\n<html>\r\n	<head>\r\n		<meta http-equiv="Content-Type" content="text/html;UTF-8" />\r\n	</head>\r\n	<body style="margin: 0px; background-color: #F4F3F4; font-family: Helvetica, Arial, sans-serif; font-size:12px;" text="#444444" bgcolor="#F4F3F4" link="#21759B" alink="#21759B" vlink="#21759B" marginheight="0" topmargin="0" marginwidth="0" leftmargin="0">\r\n<table border="0" width="100%" cellspacing="0" cellpadding="0" bgcolor="#F4F3F4">\r\n<tbody>\r\n<tr>\r\n<td style="padding: 15px;"><center>\r\n<table width="550" cellspacing="0" cellpadding="0" align="center" bgcolor="#ffffff">\r\n<tbody>\r\n<tr>\r\n<td align="left">\r\n<div style="border: solid 1px #d9d9d9;">\r\n<table id="header" style="line-height: 1.6; font-size: 12px; font-family: Helvetica, Arial, sans-serif; border: solid 1px #FFFFFF; color: #444;" border="0" width="100%" cellspacing="0" cellpadding="0" bgcolor="#ffffff">\r\n<tbody>\r\n<tr>\r\n<td style="color: #ffffff;" colspan="2" valign="bottom" height="30">.</td>\r\n</tr>\r\n<tr>\r\n<td style="line-height: 32px; padding-left: 30px;" valign="baseline"><span style="font-size: 32px;"><a style="text-decoration: none;" href="%blog_url%" target="_blank">%blog_name%</a></span></td>\r\n<td style="padding-right: 30px;" align="right" valign="baseline"><span style="font-size: 14px; color: #777777;">%blog_description%</span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table id="content" style="margin-top: 15px; margin-right: 30px; margin-left: 30px; color: #444444; line-height: 1.6; font-size: 12px; font-family: Arial,sans-serif; height: 79px;" border="0" width="491" cellspacing="0" cellpadding="0" bgcolor="#ffffff">\r\n<tbody>\r\n<tr>\r\n<td style="border-top: solid 1px #d9d9d9;" colspan="2">\r\n<div style="padding: 15px 0;">THis is a content</div>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table id="footer" style="line-height: 1.5; font-size: 12px; font-family: Arial, sans-serif; margin-right: 30px; margin-left: 30px;" border="0" width="490" cellspacing="0" cellpadding="0" bgcolor="#ffffff">\r\n<tbody>\r\n<tr style="font-size: 11px; color: #999999;">\r\n<td style="border-top: solid 1px #d9d9d9;" colspan="2">\r\n<div style="padding-top: 15px; padding-bottom: 1px;"><img style="vertical-align: middle;" src="http://localhost/can_capital/local-can/wp-admin/images/date-button.gif" alt="Date" width="13" height="13" /> Email sent %date% @ %time%</div>\r\n<div><img style="vertical-align: middle;" src="http://localhost/can_capital/local-can/wp-admin/images/comment-grey-bubble.png" alt="Contact" width="12" height="12" /> For any requests, please contact <a href="mailto:%admin_email%">%admin_email%</a></div>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="color: #ffffff;" colspan="2" height="15">.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</center></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</body>\r\n</html>";s:18:"plaintext_template";s:94:"%content%\r\n\r\n---\r\n\r\nEmail sent %date% @ %time%\r\nFor any requests, please contact %admin_email%";}', 'yes'),
